import React from 'react'
import Box from './Box'
import styled from 'styled-components'

const StyledUl = styled(Box)({
  padding:0,
  listStyle:'none'
})

const StyledLi = styled(Box)({
  paddingY: 5,
  paddingX: 10,
})

export const Ul = (props:{as:string}) => <StyledUl {...props}/>
export const Li = (props: { as: string }) => <StyledLi {...props} />

Ul.defaultProps = {
  as: 'ul'
}

Li.defaultProps = {
  as: 'li'
}
